    it('confirms non-fungible (721) immediatelly', ()=>{
      
      let selectedNFT
      
      cy.document().then(async (document)=>{
        DePayWidgets.Select({ document, what: 'nft' }).then((nft)=>{
          selectedNFT = nft
        })
        cy.wait(1000)
        cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('h1', 'Select NFT')
        cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('span', 'Choose which marketplace')
        cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.Card.Row .CardTokenSymbol .CardText', 'OpenSea').click()
        cy.get('.ReactShadowDOMOutsideContainer').shadow().find('.active input.Search').type(contractAddress, { force: true })
        cy.wait(3000)
        cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active h1', 'Confirm Selection')
        cy.get('.ReactShadowDOMOutsideContainer').shadow().find('.active .TokenImage img').invoke('attr', 'src').should('eq', 'https://i.seadn.io/gae/BdxvLseXcfl57BiuQcQYdJ64v-aI8din7WPk0Pgo3qQFhAUH-B6i-dCqqc_mCkRIzULmwzwecnohLhrcH8A9mpWIZqA7ygc52Sr81hE?w=500&auto=format')
        cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active strong', 'Please review this information')
        cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active a', '0xb47e3c...193BBB').invoke('attr', 'href').should('eq', 'https://etherscan.io/token/0xb47e3cd837dDF8e4c57F05d70Ab865de6e193BBB')
        cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active div', 'Ethereum')
        cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active a', 'CryptoPunks').invoke('attr', 'href').should('eq', 'https://opensea.io/collection/cryptopunks')
        cy.get('.ReactShadowDOMOutsideContainer').shadow().find('.active div', 'years')
        cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.ButtonPrimary', 'Confirm').click()
        cy.wait(1000).then(()=>{
          expect(selectedNFT.address).to.equal("0xb47e3cd837dDF8e4c57F05d70Ab865de6e193BBB")
          expect(selectedNFT.blockchain).to.equal("ethereum")
          expect(selectedNFT.createdAt).to.equal("2018-01-23T04:51:38.832339")
          expect(selectedNFT.image).to.equal("https://i.seadn.io/gae/BdxvLseXcfl57BiuQcQYdJ64v-aI8din7WPk0Pgo3qQFhAUH-B6i-dCqqc_mCkRIzULmwzwecnohLhrcH8A9mpWIZqA7ygc52Sr81hE?w=500&auto=format")
          expect(selectedNFT.link).to.equal("https://opensea.io/collection/cryptopunks")
          expect(selectedNFT.name).to.equal("CryptoPunks")
          expect(selectedNFT.type).to.equal("721")
        })
      })
    })
