      it('requires ID for the semi fungible token', ()=>{
        
        let selectedNFT
        
        cy.document().then(async (document)=>{
          DePayWidgets.Select({ document, what: 'nft' }).then((nft)=>{
            selectedNFT = nft
          })
          cy.wait(1000)
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('h1', 'Select NFT')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('span', 'Choose which marketplace')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.Card.Row .CardTokenSymbol .CardText', 'OpenSea').click()
          cy.get('.ReactShadowDOMOutsideContainer').shadow().find('.active input.Search').type(contractAddress, { force: true })
          cy.wait(2000)
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active label', 'Enter Token')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().find('.active input.Search').type(tokenId, { force: true })
          cy.wait(2000)
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active h1', 'Confirm Selection')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().find('.active .TokenImage img').invoke('attr', 'src').should('eq', 'https://i.seadn.io/gae/QoI3fS0edO_qc3RNXEy5O4Utujvsy3Dzn8FRgFK092ZTO1OE18FWWaKZKJnsE0SXrdy1APX793P45UHTyWb_ttZ402-YGeJsWnCcJno?w=500&auto=format')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active strong', 'Please review this information')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active a', '0x495f94...cb7b5e').invoke('attr', 'href').should('eq', 'https://etherscan.io/token/0x495f947276749Ce646f68AC8c248420045cb7b5e')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active div', 'Ethereum')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active a', 'NFT Butler Lifetime License').invoke('attr', 'href').should('eq', 'https://opensea.io/assets/ethereum/0x495f947276749ce646f68ac8c248420045cb7b5e/42745998150656004690816543961586238000273307462307754421658803578179357246440')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().find('.active div', '42745998150656004690816543961586238000273307462307754421658803578179357246440')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.ButtonPrimary', 'Confirm').click()
          cy.wait(1000).then(()=>{
            expect(selectedNFT.address).to.equal("0x495f947276749Ce646f68AC8c248420045cb7b5e")
            expect(selectedNFT.blockchain).to.equal("ethereum")
            expect(selectedNFT.image).to.equal("https://i.seadn.io/gae/QoI3fS0edO_qc3RNXEy5O4Utujvsy3Dzn8FRgFK092ZTO1OE18FWWaKZKJnsE0SXrdy1APX793P45UHTyWb_ttZ402-YGeJsWnCcJno?w=500&auto=format")
            expect(selectedNFT.link).to.equal("https://opensea.io/assets/ethereum/0x495f947276749ce646f68ac8c248420045cb7b5e/42745998150656004690816543961586238000273307462307754421658803578179357246440")
            expect(selectedNFT.name).to.equal("NFT Butler Lifetime License")
            expect(selectedNFT.type).to.equal("1155")
          })
        })
      })
