    describe('Unsported by opensea api', ()=>{

      const contractAddress = '0x6DdCC90614d47AcD7596447686c4fD6aEE782742'
      const tokenId = '1'
      const image = 'https://i.seadn.io/gcs/files/28806eaab824185d43baa9600832f9a4.jpg?auto=format&w=1000'
      const link = 'https://opensea.io/assets/matic/0x6ddcc90614d47acd7596447686c4fd6aee782742/1'
      const name = 'Matterhorn'

      let provider

      beforeEach(async()=>{
        fetchMock.get({
          url: `https://api.opensea.io/api/v1/asset_contract/${contractAddress}`,
          overwriteRoutes: true
        }, {"collection":null,"address":"0x6ddcc90614d47acd7596447686c4fd6aee782742","asset_contract_type":"unknown","created_date":"2021-11-15T08:47:44.573804","name":"Unidentified contract","nft_version":null,"opensea_version":null,"owner":null,"schema_name":"UNKNOWN","symbol":"","total_supply":null,"description":null,"external_link":null,"image_url":null,"default_to_fiat":false,"dev_buyer_fee_basis_points":0,"dev_seller_fee_basis_points":0,"only_proxied_transfers":false,"opensea_buyer_fee_basis_points":0,"opensea_seller_fee_basis_points":0,"buyer_fee_basis_points":0,"seller_fee_basis_points":0,"payout_address":null})
        provider = await getProvider('polygon')
        mock({ blockchain: 'polygon', provider, accounts: { return: accounts } })
        mock({ blockchain: 'polygon', provider, request: {
          to: '0x6ddcc90614d47acd7596447686c4fd6aee782742',
          api: Token.polygon[1155],
          method: 'balanceOf',
          params: ['0x4e260bB2b25EC6F3A59B478fCDe5eD5B8D783B02', '1'],
          return: 0
        }})
      })

      it('selects the NFT automatically if there is only 1 id for this collection', ()=>{
        
        let selectedNFT
        
        cy.document().then(async (document)=>{
          DePayWidgets.Select({ document, what: 'nft' }).then((nft)=>{
            selectedNFT = nft
          })
          cy.wait(1000)
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('h1', 'Select NFT')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('span', 'Choose which marketplace')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.Card.Row .CardTokenSymbol .CardText', 'OpenSea').click()
          cy.get('.ReactShadowDOMOutsideContainer').shadow().find('.active input.Search').type(contractAddress, { force: true })
          cy.wait(2000)
          cy.get('.ReactShadowDOMOutsideContainer').shadow().find('.active #DePayWidgetsEnterNFTTokenId').type(tokenId, { force: true })
          cy.get('.ReactShadowDOMOutsideContainer').shadow().find('.active #DePayWidgetsEnterNFTName').type(name, { force: true })
          cy.get('.ReactShadowDOMOutsideContainer').shadow().find('.active #DePayWidgetsEnterNFTImage').type(image, { force: true })
          cy.get('.ReactShadowDOMOutsideContainer').shadow().find('.active #DePayWidgetsEnterNFTLink').type(link, { force: true })
          cy.wait(1000)
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.ButtonPrimary', 'Continue').click()
          cy.wait(2000)
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active h1', 'Confirm Selection')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().find('.active .TokenImage img').invoke('attr', 'src').should('eq', image)
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active strong', 'Please review this information')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active a', '0x6DdCC9...782742').invoke('attr', 'href').should('eq', 'https://polygonscan.com/token/0x6DdCC90614d47AcD7596447686c4fD6aEE782742')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active div', 'Polygon')
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.active a', name).invoke('attr', 'href').should('eq', link)
          cy.get('.ReactShadowDOMOutsideContainer').shadow().find('.active div', tokenId)
          cy.get('.ReactShadowDOMOutsideContainer').shadow().contains('.ButtonPrimary', 'Confirm').click()
          cy.wait(1000).then(()=>{
            expect(selectedNFT.address).to.equal(contractAddress)
            expect(selectedNFT.blockchain).to.equal("polygon")
            expect(selectedNFT.image).to.equal(image)
            expect(selectedNFT.link).to.equal(link)
            expect(selectedNFT.name).to.equal(name)
            expect(selectedNFT.type).to.equal("1155")
          })
        })
      })
    })
